    false,nt"url": null,nt"notes": " n        The final evaluation of the Financial
    Services Project (FSP), undertaken by North South Consultants Exchange (NSCE), was
    undertaken from 17 April to end of September 2013   It focused on the following:nnu00b7The
    evaluation of project performances in terms of relevance, effectiveness, efficiency,
    consistence and sustainability;nu00b7The measure of perceptible results at the end
    of Compact, in terms of effects and impacts, positive or negative, expected and
    unexpected on the beneficiaries, the institutions,  the project governance, on the
    environment, as well as perception of change among the stakeholders, including the
    members of the community of the project zones compared to the project itself and
    to the results attained;nu00b7The analysis of the degree of implementation of the
    recommendations of the mid-term  evaluation of the project in order to evaluate
    if they have had an effect on the project's performance;nu00b7Developing  recommendations
    to strengthen the results of the project, to capitalise on them and to learn lessons
    from them in light of the future design and implementation of similar projectsn
